import styled from '@emotion/styled';

const Outline = styled.div`
  border: 1px solid;
`;

const Img = styled.img`
  max-width: 100%;
  height: auto;
`;

const Title = styled.h4`
  font-size: 20px;
`;

export const Card = {
  Outline,
  Img,
  Title,
};

export default Card;
